import React, { Fragment, useState } from 'react'

const Taxes = (props) => {
    const [isChecked, setIsChecked] = useState(false);

    const handleCheckboxChange = () => {
        setIsChecked(!isChecked);
    };

    return (
        <Fragment>
            <div className='header'>
                <h4>Country Revenue</h4>
            </div>
        </Fragment>
    )
}

export default Taxes
